USE [B9DA102_DATA_SOURCE]


create table Enrollment_T (
	enrollment_id INT NOT NULL IDENTITY (1000, 1),
	student_id INT,
	course_id VARCHAR(6),
	Enrollment_status VARCHAR(9),
	Date VARCHAR (10),
	CONSTRAINT enrollment_FK1 FOREIGN KEY (student_id) REFERENCES Student_T (student_id),
	CONSTRAINT enrollment_FK2 FOREIGN KEY (course_id) REFERENCES Course_T (course_id),
	CONSTRAINT pk_enrollment PRIMARY KEY (enrollment_id)

);
